import React from 'react';
import { Link, useNavigate } from 'react-router-dom';
import axios from 'axios';
import './Login.scss'; // Import your CSS file

function Login() {
  const navigate = useNavigate();

  const handleSubmit = async (event) => {
    event.preventDefault();
    
    try {
      const formData = new FormData();
      const email = formData.get('email');
      const password = formData.get('password');
      
      const response = await axios.post("http://localhost:8009/api/login", { email, password });
      console.log("Login successful", response.data);
      
      sessionStorage.setItem("userId", response.data.userData._id);
      sessionStorage.setItem("token", response.data.userData.token);
      
      navigate("/admindashboard");
    } catch (error) {
      console.log(error);
    }
  };
  
  return (
    <>
      <div className="login-page"> {/* Add a specific class to the body */}
        <meta charSet="UTF-8" />
        <meta name="viewport" content="width=device-width, initial-scale=1.0" />
        <title>Login Form</title>
        <div className="card">
          <h2>Login Form</h2>
          <div className="login_register">
            <Link to="/login" className="login">
              Login
            </Link>
            <Link to="/" className="register">
              Signup
            </Link>
          </div>
          <form className="form" onSubmit={handleSubmit}>
            <input type="email" placeholder="Email Address" className="email" />
            <input type="password" placeholder="Password" className="pass" />
            <button type="submit" className="login_btn">
              Login
            </button>
          </form>
          <Link to="#" className="fp">
            Forgot password?
          </Link>
          <div className="footer_card">
            <p>Not a member?</p>
            <Link to="/">Signup now</Link>
          </div>
        </div>
      </div>
    </>
  );
}

export default Login;
